import React from 'react';
import '../../App.css';
import { Button, Form, FormGroup, Label, Input}
  from 'reactstrap';

import {FacebookLoginButton, GoogleLoginButton} from 'react-social-login-buttons';
import { Link } from 'react-router-dom';


export default function SignUp() {
  return (
    <div className = "sign_up_container">
    <div className = "sign_up-wrapper">
      <div>
      <h2 className = "sign-up_title">Howdy!</h2>                
          <h2 className = "sign-up_title">Welcome to KSEA TAMU Chapter</h2>                
      </div>
      <form className="form-wrapper">                
          <div className = "sign-up_name">
          <label className ="sign_up_label">Email</label>           
           <input className = "sign_up_input" type="email" name="email" placeholder="your_email@tamu.edu"/>
          </div>
          <div className = "sign-up_name">

          </div>
          <div className = "sign-up_email">

          </div>
          <div className = "sign-up_email">

          </div>
          <div className = "sign-up_name">

          </div>
          <div>

          </div>
    </form>
    </div>
</div>
 );
}
